import useFetch from '../utils/useFetch';

export default function Info({ url }) {
  const { info, error } = useFetch(url);
  console.log(info, error);
  if (error) return <p>Error...</p>;
  return (
    <div>
      <h3>Confirmed:</h3>
      <span>{info.confirmed.value}</span>
    </div>
  );
}
